    const estiloProyectos = {
        backgroundColor: '#D8D8D8', // Color de fondo
        padding: '20px', // Agrega un poco de espacio alrededor del contenido
        height: 'calc(100vh - 64px)', // Altura total de la ventana menos la altura del HeaderApp
        overflowY: 'scroll', // Activa el desplazamiento vertical
    };

    return (
        <div>
            <HeaderApp /> {/* Instancia el componente HeaderApp */}
            <div style={estiloProyectos}>
                <div className='row'>
                    <div className='col-6'>
                        <h1>Proyectos</h1>
                        <p>Aquí se mostrarán los proyectos...</p>
                        {/* Aquí puedes agregar contenido específico para la sección de proyectos */}
                    </div>
                    <div className='col-6'>
                       <div className='row'>
                            <div className='col-6'> <p> <Viewer
                    runtime={{ accessToken: token }}
                    urn={urn}
                    selectedIds={selectedIds}
                    onCameraChange={onCameraChange}
                    onSelectionChange={onSelectionChange}
                    ref={refViewer}
                />.</p></div>
                            <div className='col-6'> <p>Aquí se mostrarán los proyectos...</p></div>
                       
                        {/* Aquí puedes agregar contenido específico para la sección de proyectos */}
                        </div>
                        <div className='row'>
                        <div className='col-12'></div> 
                        </div>
                   </div>
                </div>
                {/* Agrega más contenido aquí si es necesario */}
            </div>
        </div>
    );
};

export default Proyectos;
